// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './screens/Home';
import HorariosPage from './screens/Horarios'; // Importe a página de horários
import FormularioCadastro from './screens/FormularioCadastro'; // Importe a página de cadastro

const App = () => {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/horarios" component={HorariosPage} />
          <Route path="/cadastro" component={FormularioCadastro} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
